import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import TaskManager from './views/TaskManager';

const App = () => {
  return (
    <Router>
      <Routes>
        <Route path="/" element={<TaskManager />} />
        
      </Routes>
    </Router>
  );
};

export default App;
